INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("ねぇねぇ、騎士クン\n手伝ってあげようよ～", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1.4, "お！\nあそこに困ってそうな人発見！", 0, 1, "春咲 ひより", 2, 0, 0, 0, 1001, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("わ、わたし、\nなに言ってるんだろ\nあはは…", "みんなみたいに\nわたしも強くならなきゃ", 1.4, "大切な人を\n守れるようになりたい…って", 0, 1, "草野 優衣", 2, 0, 0, 0, 1002, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("少しは磨かれると思いますよ。", "フェンシングを始めてみては？", 1.4, "キミに必要な集中力と感性が", 0, 1, "士条 怜", 2, 0, 0, 0, 1003, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("みそぎはねぇ、\nかくれんぼやりたい！", "ねぇ、にいちゃん！", 1.5, "今日はなにして遊ぶ？", 0, 1, "穂高 みそぎ", 2, 0, 0, 0, 1004, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("私といっしょに…\nいかない？", "風宮あかりです", 1.4, "ねぇ…", 0, 1, "風宮 あかり", 2, 0, 0, 0, 1006, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("食べ物の恨みは怖いのー", "出雲宮子なのー", 1.5, "プリンたべたいのー", 0, 1, "出雲 宮子", 2, 0, 0, 0, 1007, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("いいよ。\n見られることは運命さ…", "ボクは虹村雪。", 1.4, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 1, "虹村 雪", 2, 0, 0, 0, 1008, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("人呼んで「疾風の冥姫」!!", "フッ…聞いて後悔するがいい！", 1.4, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 1, "柊杏奈", 2, 0, 0, 0, 1009, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("ほんまおおきにやわ～♪", "マホマホ王国のプリンセス、\nまほ姫どす", 1.5, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 1, "姫宮 真歩", 2, 0, 0, 0, 1010, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("ここで会ったが\n100年目～！", "衣之咲璃乃です！", 1.4, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 1, "衣之咲 璃乃", 2, 0, 0, 0, 1011, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("…って、お願い！\n誰にも言わないでおいて～！", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1.4, "ち、超能力って…\n何のことかな～？", 0, 1, "柏崎 初音", 2, 0, 0, 0, 1012, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("ヒデサイまぢ\nGF（グッドフィーリング）～♪", "ちょす！\n美波鈴奈だよ～♪", 1.4, "一応カリスマ読モJKやってまっす！", 0, 1, "美波 鈴奈", 2, 0, 0, 0, 1016, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("でも、沖縄もとってもいいとこさー", "はいたーい。\n喜屋武香織さー。", 1.4, "東京は遊園地みたいなところさー", 0, 1, "喜屋武 香織", 2, 0, 0, 0, 1017, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("イオちゃんって呼んでね。", "支倉伊緒です。", 1.4, "先生って呼ばれるのは\nくすぐったいから", 0, 1, "支倉 伊緒", 2, 0, 0, 0, 1018, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("ミミをおいてかないでぇ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1.5, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 1, "茜 ミミ", 2, 0, 0, 0, 1020, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("ふぇぇぇぇぇん……", "あ…あの…えっと…\n栗…林…くるみ…です……", 1.5, "あの……\nふぇ……", 0, 1, "栗林 くるみ", 2, 0, 0, 0, 1021, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("なんてありがとうございます！", "風宮よりです。\nあああああ！", 1.4, "こんな私に貴重な時間を\n割いていただき、", 0, 1, "風宮 より", 2, 0, 0, 0, 1022, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("私こっち行きたいー\nね、早く早くー", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1.5, "おにいちゃんどこいくの？\nえ？", 0, 1, "北条 綾音", 2, 0, 0, 0, 1023, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("これて何か違う…\nあああすみません！", "わっ…わっ…私、\n天野すずめといいます！", 1.4, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 1, "天野 すずめ", 2, 0, 0, 0, 1025, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("離しませんわ………\n絶対に…!!", "……クスクス…私は\n…倉石恵理子……", 1.4, "あなたは…運命の……\n伴侶……", 0, 1, "倉石 恵理子", 2, 0, 0, 0, 1027, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("…そうでしょ？？", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1.4, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 1, "佐々木 咲恋", 2, 0, 0, 0, 1028, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("あはは、\n私もまだまだだなぁ～", "桜井望だよ！\nよろしくねっ", 1.4, "ぇっと…\nキミ、私のこと知らないの?!", 0, 1, "桜井 望", 2, 0, 0, 0, 1029, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("ショーグン、\nワタシと一緒に天下統一デース！", "デケデケデンっ！", 1.4, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 1, "ニノン・ジュベール", 2, 0, 0, 0, 1030, 1, 0, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("おかしいですね……", "上喜しのぶです。\n手元のドクロが父です。", 1.4, "でもって私の隣にいるのが……\nえ、見えない？", 0, 1, "上喜 しのぶ", 2, 0, 0, 0, 1031, 1, 0, 1);
